import React, { Component } from 'react';
import TitleBar from './Titlebar/titleBar';

class App extends Component {
    constructor(props) {
        super(props);
        this.books = [
            {title: 'Ready Player One', author: 'Ernest Cline'},
            {title: 'All the Light we Cannot See', author: 'Anthony'}
        ]
    }
}

export default App;
